import React from 'react';
import PropTypes from 'prop-types';
import { Link } from 'react-router-dom';
import battle from '../../assets/mainpage/wireBattle.png';

function Result(props) {
  return (
    <div className="result">
        <div className="resultBox">
        <img alt="Battle" src={battle} style={{
                width: '300px',
                marginTop: '150px'
            }}></img>
        <h4 style={{
                 fontFamily: "TiemposHeadline",
                 fontWeight: "lighter",
                 marginTop: "50px",
                 fontSize: '50px', 
                 lineHeight: '0px',
            }}> 
                Thanks for Playing!
            </h4>
        <p>You answered {props.quizResult} of 5 questions correct!</p>
        <br></br>
        <Link to="/game">
            <button class="Thanks" variant="contained" color="primary" style={{
                border: '',
                marginTop: '0px',
                color: 'white',
                width: '180px',
                height: '40px',

            }}> 
            HOME
            </button>
        </Link>
        </div>
    </div>
  );
}

Result.propTypes = {
  quizResult: PropTypes.string.isRequired,
};

export default Result;
